INSERT INTO `Meeting` VALUES (45,1,'쓰레기 봉투&집게&운동화',37.662926,126.762071,'2022/05/28 19:00','주말에 일산 호수공원에서 플로깅 하실 분을 구합니다 ^_^!!! 저녁 먹고 만나서 플로깅하고 해지는 거 보고 헤어져요~~!! \n\n노래하는 분수대 앞쪽에서 만나서 돌아다닙시다~~!!!','https://plomeet-image.s3.ap-northeast-2.amazonaws.com/meetings/rn_image_picker_lib_temp_9d525c24-0e8e-4bae-8163-8c9f50c9408d.jpg','호수공원 주말 플로깅','일산 호수공원','경기도 고양시 일산동구 장항동 ',1,10,'2022-05-19 14:40:40'),(47,1,'쓰레기 봉투&집게&운동화',37.580530,127.007580,'2022/05/27 19:20','야경보면서 돌아요~~~\n저녁먹고 모여요!!!!','https://plomeet-image.s3.ap-northeast-2.amazonaws.com/meetings/rn_image_picker_lib_temp_51dde24f-900d-4e4e-bc66-60ea8435aa81.png','야경 플로깅','낙산공원','서울특별시 종로구 동숭동 ',2,6,'2022-05-19 14:53:00'),(48,1,'쓰레기 봉투&운동화&물',37.521334,126.941519,'2022/05/29 18:00','같이 한강 돌면서 길거리 청소해요~~!!!\n여의도 한강공원 쪽에서 만납니다\n','https://plomeet-image.s3.ap-northeast-2.amazonaws.com/meetings/rn_image_picker_lib_temp_83d07286-9a01-4c4f-858d-0260398215bf.png','한강 도실분','여의도 한강공원','서울특별시 영등포구 여의도동 ',1,4,'2022-05-19 14:54:48'),(49,1,'쓰레기 봉투&집게',37.670822,126.779327,'2022/05/31 12:30','정발산동에서 플로깅해요!\n해지는 게 예쁜 일산으로 놀러오세요 ^_^\n맛집투어도 데려가 드립니다','https://plomeet-image.s3.ap-northeast-2.amazonaws.com/meetings/rn_image_picker_lib_temp_268a2f1d-8a76-4cbd-9ad4-ccebccf480bb.jpg','정발산 플로깅','저동고등학교 앞','경기도 고양시 일산동구 정발산동 ',3,5,'2022-05-19 14:57:11'),(50,1,'쓰레기 봉투&집게&운동화',37.551648,126.993209,'2022/05/27 14:30','같이 강아지 산책시켜요!!!\n저희집 강아지 되게 큽니다!!!\n괜찮으신 분들만요!!!!','https://plomeet-image.s3.ap-northeast-2.amazonaws.com/meetings/rn_image_picker_lib_temp_17e4f742-d7af-4ece-8bc0-d160b4ab97ad.jpg','강아지 산책시켜요!!','남산공원','서울특별시 중구 예장동 ',1,4,'2022-05-19 15:01:49'),(51,1,'집게&뮬티슈&도시락',37.591557,126.926941,'2022/05/28 05:50','내가 키워줌','https://plomeet-image.s3.ap-northeast-2.amazonaws.com/meetings/rn_image_picker_lib_temp_c7baab89-7b79-43ba-ae44-53fcf12db6d6.jpg','플로깅마스터랑 플로깅할사람','산','서울특별시 은평구 응암동 ',1,8,'2022-05-19 15:04:17'),(52,1,'쓰레기 봉투&집게&운동화',35.803656,129.227606,'2022/05/22 16:00','경주의 겹벚꽃은 늦게도 피어이씁니다 ㅎㅎ\n같이 겹벚꽃 구경하실 분!!!\n경주 투어도 같이 해요','https://plomeet-image.s3.ap-northeast-2.amazonaws.com/meetings/rn_image_picker_lib_temp_5e723ee9-ccc7-4abf-895c-3c32aba23e35.jpg','벚꽃 플로깅','불국사','경상북도 경주시 배동 ',1,4,'2022-05-19 15:07:05'),(53,1,'쓰레기 봉투&집게&물티슈&목장갑&운동화&도시락',37.508738,127.099995,'2022/06/18 15:00','플로깅 모임 플로플로와 함께 플로깅 하실 분을 구합니다^^ 매주 만나서 플로깅을 진행하고 있습니다~~~ 관심있으신 분은 채팅으로 연락주세요','https://plomeet-image.s3.ap-northeast-2.amazonaws.com/meetings/rn_image_picker_lib_temp_60b389a6-e82c-4f4e-8ef0-611ff9758e3a.jpg','내가 바로 플로깅 마스터','석촌호수','서울특별시 송파구 잠실동 ',1,20,'2022-05-19 15:12:18'),(54,1,'쓰레기 봉투&면장갑&운동화',37.554801,126.895404,'2022/05/20 13:00','내일 낮에 망원 한강공원에서 플로깅 하실분!','https://plomeet-image.s3.ap-northeast-2.amazonaws.com/meetings/EC34E40D-DD06-4533-90CC-35531EC71DDF.jpg','망원에서 플로깅하실분','망원 한강 공원','서울특별시 마포구 망원동 ',1,3,'2022-05-19 15:30:09'),(55,1,'쓰레기 봉투&뮬티슈',37.611388,126.844489,'2022/05/28 03:30','플로깅할사람~','https://plomeet-image.s3.ap-northeast-2.amazonaws.com/meetings/','같이 플로깅 해요! ','기차역','경기도 고양시 덕양구 강매동 ',3,8,'2022-05-19 15:36:26'),(56,1,'쓰레기 봉투&면장갑',37.556036,126.910104,'2022/05/20 14:00','저희 모임 종료지가 망원동이라 다같이 티라미수 필수로 먹고 파합니다.\r 함께해요~','https://plomeet-image.s3.ap-northeast-2.amazonaws.com/meetings/rn_image_picker_lib_temp_621c6813-a0d9-4982-9cba-c31fe5f90370.jpg','끝나고 망원동 티라미수 먹어요','망원역','서울특별시 마포구 서교동',1,5,'2022-05-19 16:42:03'),(57,1,'쓰레기 봉투&집게&운동화&물&도시락',37.555308,126.895209,'2022/05/23 17:00','여유롭게 플로깅 같이하실분!','https://plomeet-image.s3.ap-northeast-2.amazonaws.com/meetings/BB83BDD9-52E0-4266-AD60-38806B5F9752.jpg','망원 산책 겸 플로깅','망원 한강공원','서울특별시 마포구 망원동 ',2,5,'2022-05-19 16:42:05'),(58,1,'쓰레기 봉투&집게&운동화&물',37.554965,126.895242,'2022/05/27 20:00','처음 플로깅해봐요! 같이 플로깅하실분 모이세요~!','https://plomeet-image.s3.ap-northeast-2.amazonaws.com/meetings/','망원에서 플로깅 - 초보 환영','망원역','서울특별시 마포구 망원동 ',1,5,'2022-05-19 16:44:32'),(59,1,'쓰레기 봉투&집게&운동화',37.553801,126.897284,'2022/05/23 06:30','다음주부터 일찍 일어나서 플로깅 겸 운동하려고 하는데 혼자하기엔 힘들거 같아서 같이 하실분 구해요!','https://plomeet-image.s3.ap-northeast-2.amazonaws.com/meetings/03D917AD-157F-45D7-